import{_ as t,o,c as r,z as a,a as i,t as n,V as h}from"./chunks/framework.055571f3.js";const S=JSON.parse('{"title":"应用方向","description":"","frontmatter":{"title":"应用方向"},"headers":[],"relativePath":"ros/frame/application.md","filePath":"ros/frame/application.md","lastUpdated":1681960495000}'),s={name:"ros/frame/application.md"},l={id:"frontmatter-title",tabindex:"-1"},c=a("a",{class:"header-anchor",href:"#frontmatter-title","aria-label":'Permalink to "{{$frontmatter.title}}"'},"​",-1),p=h('<div class="tip custom-block"><p class="custom-block-title">TIP</p><p>许多ROS团队伴随ROS成长到今日，其规模已经发展到足以被认为是独立组织的程度了。在导航、机械臂、无人驾驶、无人机等诸多领域大放异彩，下面列出了其中的一些团队项目，这些项目对我们以后的进阶发展，也提供了指导。</p></div><br><hr><h2 id="nav2" tabindex="-1">NAV2 <a class="header-anchor" href="#nav2" aria-label="Permalink to &quot;NAV2&quot;">​</a></h2><p>Nav2项目继承自ROS Navigation Stack。该项目旨在可以让移动机器人从A点安全的移动到B点。它也可以应用于涉及机器人导航的其他应用，例如跟随动态点。Nav2将用于实现路径规划、运动控制、动态避障和恢复行为等一系列功能。</p><hr><h2 id="opencv" tabindex="-1">OpenCV <a class="header-anchor" href="#opencv" aria-label="Permalink to &quot;OpenCV&quot;">​</a></h2><p>OpenCV（Open Source Computer Vision Library）是一个开源的计算机视觉和机器学习软件库。OpenCV旨在为计算机视觉应用程序提供通用基础架构，并加速机器感知在商业产品中的使用。OpenCV允许企业轻松地使用和修改代码。</p><hr><h2 id="moveit" tabindex="-1">MoveIt <a class="header-anchor" href="#moveit" aria-label="Permalink to &quot;MoveIt&quot;">​</a></h2><p>MoveIt是一组ROS软件包， 主要包含运动规划、碰撞检测、运动学、3D感知、操作控制等功能。它可以用于构建机械臂的高级行为。MoveIt现在可以用于市面上的大多数机械臂，并被许多大公司使用。</p><hr><h2 id="the-autoware-foundation" tabindex="-1">The Autoware Foundation <a class="header-anchor" href="#the-autoware-foundation" aria-label="Permalink to &quot;The Autoware Foundation&quot;">​</a></h2><p>Autoware Foundation是ROS下属的非营利组织，支持实现自动驾驶的开源项目。Autoware基金会在企业发展和学术研究之间创造协同效应，为每个人提供自动驾驶技术。</p><hr><h2 id="f1-tenth" tabindex="-1">F1 Tenth <a class="header-anchor" href="#f1-tenth" aria-label="Permalink to &quot;F1 Tenth&quot;">​</a></h2><p>F1 Tenth是将模型车改为无人车的竞速赛事，是一个由研究人员、工程师和自主系统爱好者组成的国际社区。它最初于 2016 年在宾夕法尼亚大学成立，但后来扩展到全球许多其他机构。</p><hr><h2 id="microros" tabindex="-1">microROS <a class="header-anchor" href="#microros" aria-label="Permalink to &quot;microROS&quot;">​</a></h2><p>在基于ROS的机器人应用中，micro-ROS正在弥合性能有限的微控制器和一般处理器之间的差距。micro-ROS在各种嵌入式硬件上运行，使ROS能直接应用于机器人硬件。</p><hr><h2 id="open-robotics" tabindex="-1">Open Robotics <a class="header-anchor" href="#open-robotics" aria-label="Permalink to &quot;Open Robotics&quot;">​</a></h2><p>Open Robotics与全球ROS社区合作，为机器人创建开放的软件和硬件平台，包括 ROS1、ROS2、Gazebo模拟器和Ignition模拟器。Open Robotics使用这些平台解决一些重要问题，并通过为各种客户组织提供软件和硬件开发服务来帮助其他人做同样的事情。</p><hr><h2 id="px4" tabindex="-1">PX4 <a class="header-anchor" href="#px4" aria-label="Permalink to &quot;PX4&quot;">​</a></h2><p>PX4是一款用于无人机和其他无人驾驶车辆的开源飞行控制软件。该项目为无人机开发人员提供了一套灵活的工具，用于共享技术并为无人机应用程序创建量身定制解决方案。</p><hr><h2 id="ros-industrial" tabindex="-1">ROS-Industrial <a class="header-anchor" href="#ros-industrial" aria-label="Permalink to &quot;ROS-Industrial&quot;">​</a></h2><p>ROS-Industrial是一个开源项目，将 ROS 软件的高级功能扩展到工业相关硬件和应用程序。</p>',29);function d(e,u,m,b,f,O){return o(),r("div",null,[a("h1",l,[i(n(e.$frontmatter.title)+" ",1),c]),p])}const R=t(s,[["render",d]]);export{S as __pageData,R as default};
